import { http } from '@/services'

export default (baseURL, options = {}) => {
  const httpClient = http({ baseURL, ...options })

  const getBanks = () => httpClient
    .get('/posts/1')
    .catch((error) => Promise.reject(error))

  return {
    getBanks
  }
}
